```scala
import org.apache.spark.api.java.JavaRDD
import org.apache.spark.api.java.function.Function
import org.apache.spark.broadcast.Broadcast
import org.apache.spark.sql.SparkSession
import scala.collection.mutable
import scala.collection.mutable.ListBuffer

object HitRateCalculator {
  def main(args: Array[String]): Unit = {
    val spark = SparkSession.builder()
      .appName("HitRateCalculator")
      .master("local[*]")
      .getOrCreate()

    // Load onsite attributed data
    val onsiteData: JavaRDD[String] = spark.read
      .textFile("path/to/onsite/data")
      .javaRDD

    // Load top frequent queries
    val topQueries: JavaRDD[String] = spark.read
      .textFile("path/to/top/queries")
      .javaRDD

    // Broadcast top queries to all nodes
    val broadcastTopQueries: Broadcast[Array[String]] = spark.sparkContext.broadcast(topQueries.collect())

    // Initialize cache
    val cache = mutable.Map[String, (Long, Long)]()

    // Process onsite data
    val hitRate = onsiteData.mapPartitions(iter => {
      val cachePart = mutable.Map[String, (Long, Long)]()
      val hitCount = new ListBuffer[Long]()
      val missCount = new ListBuffer[Long]()

      while (iter.hasNext) {
        val line = iter.next()
        val Array(query, timestamp) = line.split(" ")

        if (broadcastTopQueries.value.contains(query)) {
          val cacheEntry = cachePart.getOrElseUpdate(query, (timestamp.toLong, 0L))
          val (lastAccessTime, hitOrMiss) = cacheEntry

          if (hitOrMiss == 0L || (timestamp.toLong - lastAccessTime) <= 12 * 60 * 60 * 1000) {
            // Cache hit
            cachePart.update(query, (timestamp.toLong, 1L))
            hitCount += 1
          } else {
            // Cache miss
            cachePart.update(query, (timestamp.toLong, 0L))
            missCount += 1
          }
        }
      }

      // Update global cache
      cache ++= cachePart

      Iterator((hitCount.sum, missCount.sum))
    }).reduce((a, b) => (a._1 + b._1, a._2 + b._2))

    // Calculate hit rate
    val totalQueries = hitRate._1 + hitRate._2
    val hitRateValue = if (totalQueries > 0) hitRate._1.toDouble / totalQueries else 0.0

    println(s"Hit rate: $hitRateValue")

    spark.stop()
  }
}
```
This job first loads the onsite attributed data and top frequent queries from their respective paths. It then broadcasts the top frequent queries to all nodes in the cluster.

The job then initializes a cache to store the queries and their last access times. It processes the onsite data in parallel using the `mapPartitions` transformation, which allows us to maintain a local cache for each partition.

For each query in the onsite data, the job checks if it is present in the top frequent queries. If it is, the job checks if the query is already in the cache and if it has been accessed within the last 12 hours. If it has, the job counts it as a cache hit and updates the cache entry. If it hasn't, the job counts it as a cache miss and updates the cache entry.

After processing all the data, the job calculates the hit rate by dividing the number of cache hits by the total number of queries. It then prints the hit rate to the console.

