Here is a simple Go application that implements a DNS server using the `miekg/dns` package. This server forwards all requests to Google's public DNS (8.8.8.8) and Cloudflare's public DNS (1.1.1.1), and stores the resolved IP addresses in a map.

```go
package main

import (
	"fmt"
	"log"
	"net"
	"sync"

	"github.com/miekg/dns"
)

var (
	ipsMap     = make(map[string][]string)
	ipsMapLock sync.Mutex
)

func main() {
	dns.HandleFunc(".", handleRequest)

	server := &dns.Server{
		Addr: ":53",
		Net:  "udp",
	}

	err := server.ListenAndServe()
	if err != nil {
		log.Fatalf("Failed to start the server: %v", err)
	}
}

func handleRequest(w dns.ResponseWriter, r *dns.Msg) {
	m := new(dns.Msg)
	m.SetReply(r)

	for _, q := range r.Question {
		ips, ok := ipsMap[q.Name]
		if ok {
			for _, ip := range ips {
				rr, _ := dns.NewRR(fmt.Sprintf("%s A %s", q.Name, ip))
				m.Answer = append(m.Answer, rr)
			}
			w.WriteMsg(m)
			return
		}
	}

	client := new(dns.Client)
	response, _, err := client.Exchange(r, "8.8.8.8:53")
	if err != nil {
		response, _, err = client.Exchange(r, "1.1.1.1:53")
		if err != nil {
			log.Printf("Failed to forward request: %v", err)
			return
		}
	}

	for _, ans := range response.Answer {
		if a, ok := ans.(*dns.A); ok {
			ipsMapLock.Lock()
			ipsMap[a.Hdr.Name] = append(ipsMap[a.Hdr.Name], a.A.String())
			ipsMapLock.Unlock()
		}
	}

	w.WriteMsg(response)
}
